.section__title {
  max-width: 80rem;
  margin: 0 auto 8rem auto;

  @include respond(tab-port) {
    text-align: center;
  }
}

.section__description {
  font-size: 1.8rem;
  font-weight: 600;
  text-transform: uppercase;
  color: rgba($color-primary-dark, 0.5);
  margin-bottom: 1rem;

  @include respond(tab-port) {
    text-align: center;
  }
}

.section__header {
  font-size: 4rem;
  line-height: 1.3;
  font-weight: 500;
  margin-bottom: 10rem;

  @include respond(tab-port) {
    margin-bottom: 12rem;
    text-align: center;
  }
}
